<script lang="ts" setup>
import { ref, onMounted, computed } from 'vue'
import {message} from 'ant-design-vue'

onMounted(() => {
    loadData()
})

const handlerConfirm = ()=>{
    const token = window.localStorage.getItem("token")
    fetch("/api/careManage/audit",{
        headers: {
            'Content-type': 'application/json',
            token: token+""
        },
        method: 'PUT',
        body: JSON.stringify(labelProject)
    }).then(res=>res.json())
    .then(data=>{
        console.log(data)
        message.success("提交审核成功")
    })
}

const loadData = () => {
    const token = window.localStorage.getItem("token")
    fetch("/api/careManage/getMenuTree", {
        method: 'GET',
        headers: {
            'Content-type': 'application/json',
            token: token + ""
        }
    }).then(res => res.json())
        .then(data => {
            headerTypes.value = data.data
            handlerReloadList(headerTypes.value[0].children[0])

        })
}

const selectedDataSource = ref<any>([])

const onSelectChange = (selectedRowKeys: any[]) => {
    selectedKeys.value = selectedRowKeys
}

